import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div>
      <div className="topnav">
        <button class="tablinks">Produits</button>
        <button class="tablinks">Clients</button>
        <button class="tablinks">About us</button>
      </div>
    </div>
  );
}

export default App;
